L'ISO 639-2 est une des parties de la norme ISO 639 définissant une codification des noms de langues, avec un niveau de détail linguistique intermédiaire. La liste des codes ISO 639-2 est présentée dans la série de tableaux alphabétiques déroulant ci-dessous, regroupant les codes suivants : 
* Code ISO 639-2, à trois lettres (alpha-3), objet du présent article ; 
* Code ISO 639-3, à trois lettres (alpha-3) correspondant (identique en général) ; 
* Code ISO 639-1 à deux lettres (alpha-2) correspondant, lorsqu'il existe. Certains indicatifs ont des significations spéciales : 
* mis, pour « sans code », dans les cas où la langue est identifiée mais ne dispose pas de code alpha-3 ; 
* mul, pour « multilingue », dans les cas où un fragment utilise plusieurs langues, et qu'il n'est pas pratique de les identifier séparément ; 
* und, pour « indéterminée », dans les cas où le fragment contient du contenu linguistique, mais qu'il n'est pas possible d'identifier la langue ; 
* zxx, pour « pas de contenu linguistique ; non applicable », dans les cas où le fragment de texte n'a pas de contenu linguistique, mais où un code langue est cependant souhaité ; 
* la plage qaa à qtz est réservée à l'usage privé, dans les cas où la langue ne dispose pas d'un identifiant alpha-3. Lorsque deux codes alpha-3 de l'ISO 639-2, séparés par un « / » (barre oblique), sont indiqués dans la liste, le premier correspond au code bibliographique (code « B ») et le deuxième au code terminologique (code « T ») : seul ce deuxième code terminologique est inclus dans ISO 639-3.

ISO 639 is a set of international standards that lists short codes for language names. The following is a complete list of three-letter codes defined in part two (ISO 639-2) of the standard, including the corresponding two-letter (ISO 639-1) codes where they exist. Where two ISO 639-2 codes are given in the table, the one with the asterisk is the bibliographic code (B code) and the other is the terminological code (T code). Entries in the Scope column distinguish: 
* individual language 
* collections of languages connected, for example genetically or by region 
* macrolanguages. The Type column distinguishes: 
* ancient languages (extinct since ancient times); 
* historical languages (distinct from their modern form); 
* extinct languages in recent times; 
* constructed languages. The standard includes some codes for special situations: 
* mis, for "uncoded languages"; 
* mul, for "multiple languages"; 
* qaa-qtz, a range reserved for local use. 
* und, for "undetermined"; 
